@EscarlateOHara @praxis_edficant @PaolaCarosella Vou te dizer como faço (não sei se é "o certo", mas dá certo):

- Uso uma panela razoavelmente grande (± tamanho 26) quase cheia;

- Coloco um ponhado (mão fechada) de sal;

- Faço meio pacote (de 500g) de massa (ou pouco mais): ≈ 300 a 350g

O ideal é não salgar demais o molho.
